"use strict";
let Values;
Values = 100;
console.log(typeof Values); // its number type
Values = 'karthick';
console.log(typeof Values); // its string type
Values = [1, 2, 3];
console.log(typeof Values); // its string[] array
Values = [1, 2, 3, 'hi', 'hello'];
console.log(typeof Values); // its union array of (string | number) []
